column8:
エンジンシステムから追求した高信頼性ウォーターポンプ<br><br>冷却水漏れ防止の要であるメカニカルシールの材質をアルミナから炭化ケイ素（SiC）とすることで、摺動部の発熱と摺動部材の磨耗を抑え、シール性を向上<br>ベアリングのリア側シールを3重リップシールとし、メカニカルシールより冷却水が漏れた場合のベアリング内部への侵入によるベアリング破損を防止<br><br> 純正 新品番：17400-50813/17400-70830/AZ12-15-010B<br>純正 旧品番：17400-50811/17400-50812/17400-50813/17400-70830/AZ01-15-010/AZ12-15-010/AZ12-15-010A/AZ12-15-010B/AZ13-15-010<style type="text/css">
